description:
Frank Falenczyk alskar sitt jobb. Han ar yrkesmordare och har just avslutat
det storsta jobbet under sin karriar. Pa order fran sin boss, maste han lamna
sitt hem i Buffalo, New York. Sluta med vodkan och flytta till San Francisco
for rehabilitering. Och far jobb pa en begravningsbyra...
Med: Ben Kingsley, Cory Cassidy, Jayne Eastwood, Dennis Farina m fl..
